(15, '119', 32, '1632', 'Industrial diamonds, unworked or simply sawn, cleaved or bruted; pumice stone; emery; natural corundum, natural garnet and other natural abrasives', 'শিল্পজাত ডায়মন্ড যাহা সামান্য করাত দিয়ে কাটা বা নমুনা করা নয় ঝামা পাথর, পলিশের কাজে ব্যবহৃত ধাতব, প্রাকৃতিক উপরত্ন বা পাথর এবং অন্যান্য পাথর যাহা মসৃন করার কাজে ব্যবহৃত হয়'),
(16, '120', 32, '1633', 'Chalk and dolomite', 'চুনাপাথর এবং পাথরের টেবিল'),
(17, '121', 32, '1639', 'Other minerals n.e.c.', 'অন্যান্য খনিজ পদার্থ যা অন্যত্র শ্রেণীভূক্ত হয়নি'),
(18, '122', 33, '1710', 'Electrical energy', 'বৈদ্যুতিক শক্তি'),
(19, '123', 34, '1720', 'Coal gas, water gas, producer gas and similar gases, other than petroleum gases and other gaseous hydrocarbons', 'কয়লা ও পানি হতে উৎপন্ন গ্যাস, উৎপাদিত গ্যাস এবং একই জাতীয় গ্যাস সমূহ (পেট্রোলিয়াম থেকে উৎপন্ন গ্যাস ও হাইড্রো কার্বন গ্যাস ব্যতীত)'),
